        console.log(this.patient_visit_details);
      }
    });
  }

  getPatientexpenses() {
    let query = `select * from patient_expenses where patient_id = ${this.patient_id};`;
    this.db.processQuery(query).subscribe(patient_expenses => {
      if (patient_expenses.length === 0) {
